import React from "react";
import styled from "styled-components";

const Chat = () => {
  return <Container>
    <ChatContainer></ChatContainer>
  </Container>;
};

const Container = styled.div`
  max-width: 100vw;
  height: 100vh;
  background: #131224;
  display: flex;
  align-items: center;
  justify-content: center;
`;

export default Chat;
